import Layout from '../Components/Layout'

const About = () => (
    <Layout>
        <div>
            <h1 className='container'>About</h1>
            <div className='container'>
                The purpose of this website is for those currently investing in the cryptocurrency bitcoin stock market. <br/>
                Welcome to BitzPrice. 
            </div>
        </div>

    </Layout>
);

export default About;
